"use client"

import { useState } from "react"
import { Link, useNavigate } from "react-router-dom"
import { useAuth } from "../../contexts/AuthContext"
import { useAuth0 } from "@auth0/auth0-react"
import "./AuthPages.css"

const LoginPage = () => {
  const [usernameOrEmail, setUsernameOrEmail] = useState("")
  const [password, setPassword] = useState("")
  const [error, setError] = useState("")
  const [loading, setLoading] = useState(false)
  const { login } = useAuth()
  const navigate = useNavigate()

  // Get Auth0 authentication methods
  const { loginWithRedirect, isLoading: auth0Loading } = useAuth0()

  const handleSubmit = async (e) => {
    e.preventDefault()
    setError("")

    // Form validation
    if (!usernameOrEmail.trim() || !password) {
      setError("Please fill in all fields")
      return
    }

    try {
      setLoading(true)
      const result = await login({ usernameOrEmail, password })

      if (result.success) {
        navigate("/")
      } else {
        setError(result.error || "Failed to login. Please check your credentials.")
      }
    } catch (err) {
      setError("An unexpected error occurred. Please try again.")
      console.error("Login error:", err)
    } finally {
      setLoading(false)
    }
  }

  // Handle Google login through Auth0
  const handleGoogleLogin = () => {
    loginWithRedirect({
      connection: "google-oauth2",
      appState: { returnTo: "/" },
    })
  }

  return (
    <div className="auth-container">
      <div className="auth-card">
        <div className="auth-header">
          <h2>Welcome Back</h2>
          <p>Sign in to your SkillUp account</p>
        </div>

        {error && <div className="auth-error">{error}</div>}

        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-control">
            <label htmlFor="usernameOrEmail">Username or Email</label>
            <input
              type="text"
              id="usernameOrEmail"
              value={usernameOrEmail}
              onChange={(e) => setUsernameOrEmail(e.target.value)}
              placeholder="Enter your username or email"
              disabled={loading || auth0Loading}
            />
          </div>

          <div className="form-control">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Enter your password"
              disabled={loading || auth0Loading}
            />
          </div>

          <button type="submit" className="btn btn-primary w-full" disabled={loading || auth0Loading}>
            {loading ? "Signing in..." : "Sign In"}
          </button>

          <div className="auth-divider">
            <span>OR</span>
          </div>

          {/* Google Sign In Button */}
          <button
            type="button"
            onClick={handleGoogleLogin}
            disabled={loading || auth0Loading}
            className="btn btn-google"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              gap: "10px",
              width: "100%",
              padding: "10px",
              backgroundColor: "#fff",
              border: "1px solid #dadce0",
              borderRadius: "4px",
              color: "#3c4043",
              fontFamily: "Roboto, sans-serif",
              fontSize: "14px",
              fontWeight: "500",
              height: "40px",
              cursor: "pointer",
            }}
          >
            <img src="/google.png" alt="Google" style={{ width: "18px", height: "18px" }} />
            {auth0Loading ? "Connecting..." : "Sign in with Google"}
          </button>
        </form>

        <div className="auth-footer">
          <p>
            Don't have an account? <Link to="/register">Sign Up</Link>
          </p>
        </div>
      </div>
    </div>
  )
}

export default LoginPage
